        var magic = Math.sin(radLat);
        magic = 1 - ee * magic * magic;
        var sqrtMagic = Math.sqrt(magic);
        dLat = dLat * 180.0 / (a * (1 - ee) / (magic * sqrtMagic) * this.PI);
        dLon = dLon * 180.0 / (a / sqrtMagic * Math.cos(radLat) * this.PI);
        return {
            'lat': dLat,
            'lng': dLon
        };
    },
    gcj_encrypt: function gcj_encrypt(wgsLat, wgsLon) {
        if (this.outOfChina(wgsLat, wgsLon)) {
            return {
                'lat': wgsLat,
                'lng': wgsLon
            };
        }
        var d = this.delta(wgsLat, wgsLon);
        return {
            'lat': wgsLat + d.lat,
            'lng': wgsLon + d.lng
        };
    },
    gcj_decrypt: function gcj_decrypt(gcjLat, gcjLon) {
        if (this.outOfChina(gcjLat, gcjLon)) {
            return {
                'lat': gcjLat,
                'lng': gcjLon
            };
        }
        var d = this.delta(gcjLat, gcjLon);
        return {
            'lat': gcjLat - d.lat,
            'lng': gcjLon - d.lng
        };
    },
    gcj_decrypt_exact: function gcj_decrypt_exact(gcjLat, gcjLon) {
        var initDelta = 0.01;
        var threshold = 0.000000001;
        var dLat = initDelta;
        var dLon = initDelta;
        var mLat = gcjLat - dLat;
        var mLon = gcjLon - dLon;
        var pLat = gcjLat + dLat;
        var pLon = gcjLon + dLon;
        var wgsLat = void 0;
        var wgsLon = void 0;
        var i = 0;
        while (1) {
            wgsLat = (mLat + pLat) / 2;
            wgsLon = (mLon + pLon) / 2;
            var tmp = this.gcj_encrypt(wgsLat, wgsLon);
            dLat = tmp.lat - gcjLat;
            dLon = tmp.lng - gcjLon;
            if (Math.abs(dLat) < threshold && Math.abs(dLon) < threshold) {
                break;
            }
            if (dLat > 0) {
                pLat = wgsLat;
            } else {
                mLat = wgsLat;
            }
            if (dLon > 0) {
                pLon = wgsLon;
            } else {
                mLon = wgsLon;
            }
            if (i > 10000) {
                break;
            }
            i += 1;
        }
        return {
            'lat': wgsLat,
            'lng': wgsLon
        };
    },
    bd_encrypt: function bd_encrypt(gcjLat, gcjLon) {
        var x = gcjLon;
        var y = gcjLat;
        var z = Math.sqrt(x * x + y * y) + 0.00002 * Math.sin(y * this.x_pi);
        var theta = Math.atan2(y, x) + 0.000003 * Math.cos(x * this.x_pi);
