        return stopTime;
    },
    getPostion: function getPostion(lng, lat) {
        var _this = this;

        var geoc = new BMap.Geocoder();
        var posPoint = new BMap.Point(lng, lat);
        var address = '';
        geoc.getLocation(posPoint, function(rs) {
            _this.address = rs.address;
